import React, {Component} from 'react';
import Grid from '@material-ui/core/Grid';
import Button from '@material-ui/core/Button';
import "./ManageCharges.css";
import MaterialTable from "material-table";

export default class ManageCharges extends Component{
    constructor(props){
        super(props);
        this.state= {
            role : window.localStorage.getItem('Role'),
        }
    }
    render(){
        return(
            <Grid item lg={12} sm={12} className="mngchrg-container">
              <Grid item lg={12} sm={12} className="header">
                <div className="head-title"><h2>Welcome {this.state.role}</h2></div>
              </Grid>
              <Grid item lg={12} sm={12} className="mngchrg-table">
                  <div className="title">Manage Charges</div>
                  <div className="btn-container">                    
                    <Button variant="contained" color="primary" className="btn-grp"> Group </Button>
                    <Button variant="contained" className="btn-ungrp">Ungroup</Button>
                    <div className="profit-text">Profit Margin : <span style={{color:"#379efd", fontWeight:"bold"}}>INR 301.63 (16%)</span></div>
                  </div>
                  <div>
                  <MaterialTable
                    columns={[
                        { title: "Adı", field: "name" },
                        { title: "Soyadı", field: "surname" },
                        { title: "Doğum Yılı", field: "birthYear", type: "numeric" },
                        {
                        title: "Doğum Yeri",
                        field: "birthCity",
                        lookup: { 34: "İstanbul", 63: "Şanlıurfa" },
                        },
                    ]}
                    data={[
                        {
                        name: "Mehmet",
                        surname: "Baran",
                        birthYear: 1987,
                        birthCity: 63,
                        },
                    ]}
                    title="Demo Title"
                    />
                            </div>
              </Grid>
            </Grid>
        )
    }
}
